import React from 'react';
import {Col, Row} from 'react-bootstrap/'

// Det bruker skal se når de kommer inn på nettside når de er allerede logget it

const Dashboard = () => {
    return(
      <Row>
        <Col bg='primary' xs={6}>
          <h1>Hei</h1>
        </Col>
        <Col>
          <h1>Hei</h1>
        </Col>
     
      </Row>
    );
};
export default Dashboard;
